const APIKEY = "bfd53bff5768a6e9436bd728deea42b7";

const requests = {
    fetchTrending: `/trending/all/week?api_key=${APIKEY}&language=en-US`,
    fetchTopRated: `/movie/top_rated?api_key=${APIKEY}&language=en-US`,
}

export default requests;
